import Container from './Container';
import Paragraph from './main/Paragraph';
import Title from './Title';

const Foot = styled.footer`
  background-color: ${colors().grey};
  min-height: 200px;
  padding: 30px 0;
`;

const FooterBox = styled.div``;

const Par = styled.p`
  padding: 20px 0;
  font-size: 20px;
  line-height: 1.4;
  color: ${colors().navy1};
`;

const Phone = styled.div`
  display: flex;
  align-items: center;
  i {
    color: ${colors().orange};
    margin: 0 8px;
    font-size: 22px;
  }

  a {
    font-size: 20px;
    font-weight: 700;
    color: ${colors().navy2};
  }
`;

const Copyright = styled.div`
  margin: 20px 0 -20px;

  span {
    display: inline-block;
    text-align: center;
    font-size: 12px;
    color: ${colors().grey};
  }
`;

